export default function Logo() {
  return (
    <div style={{ display: 'flex', alignItems: 'center', gap: '0px' }}>
      <img src="/cropped-___new.jpg" alt="ОДК Сатурн" style={{ height: '50px', borderRadius: '8px' }} />
      <img src="/8695ce94-6b12-4e14-bf14-1bb5a710e778.png" alt="Доп. логотип" style={{ height: '50px', borderRadius: '8px' }} />
    </div>
  );
}
